import { useEffect, useState } from "react";

const useFetch = (url) => {
    const [data,setData]=useState('');

    useEffect(()=>{
        fetch(url)
            .then(res=>{
                return res.json();
            })
            .then(data=>{
                setData(data)
            })
    })
}
 
export default useFetch;url
